import React, { useState, useEffect } from "react";
import styled from 'styled-components'

const Landing = () => {
  return (
    <Container>
        <h1>Ideal pookie finder</h1>
        <img className="top-img" src="https://i.pinimg.com/originals/8c/bb/9b/8cbb9b70ce1e8f18f721119a064c1c3b.gif" alt="" />
        <p>"Using insights from over 100,000 Indian profiles across Instagram, Facebook, and Tinder, we’ve developed an AI model with advanced intelligence to predict the ideal partner for you. Our technology is designed to understand your unique preferences and match you with someone you’ll truly connect with."</p>
    </Container>
  )
}

export default Landing

const Container = styled.div`
    background-color: whitesmoke;
    height: 100vh;
    width: 100%;
    max-width: 500px;
    padding: 50px;

    display: flex;
    flex-direction: column;
    align-items: center;

    h1{
        font-weight: 600;
    }

    p{
        text-align: center;
        font-weight: 300;
        font-style: italic;
    }

    .top-img{
        width: 200px;
        aspect-ratio: 1/1;
        border-radius: 50%;
    }
`
